        public static bool DoesMouseCollideWithArea(int x, int y, int width, int height)
        {
            //If we are clicking on something other then the startmenu, close
            if (UiMouse.MouseY >= y && UiMouse.MouseY <= y + height)
            {
                if (UiMouse.MouseX >= x && UiMouse.MouseX <= x + width)
                {
                    return true;
                }
            }

            return false;
        }



